import axios from "axios";
import React, { useState, useEffect } from "react";

function Navbar() {
  const [user, setUser] = useState(null);
  const [isDropdownOpen, setDropdownOpen] = useState(false);

  // Fetch user data when token changes
  useEffect(() => {
    const fetchUser = async () => {
      const token = localStorage.getItem("token");

      if (!token) {
        setUser(null); // Ensure user is cleared when no token
        return;
      }

      try {
        const response = await axios.get("http://localhost:4600/api/auth/me", {
          headers: { Authorization: `Bearer ${token}` },
        });

        console.log("User Data:", response.data);
        setUser(response.data);
      } catch (error) {
        console.error("Error fetching user:", error);
        setUser(null);
      }
    };

    fetchUser();
  }, [localStorage.getItem("token")]); // Trigger fetch when token changes

  // Logout function
  const handleLogout = () => {
    localStorage.removeItem("token"); // Remove token
    setUser(null); // Clear user data
    window.location.reload(); // Refresh to reflect logout
  };

  const toggleDropdown = () => {
    setDropdownOpen(!isDropdownOpen);
  };

  return (
    <div>
      {/* Navbar */}
      <nav
        className="layout-navbar container-xxl navbar navbar-expand-xl navbar-detached align-items-center bg-navbar-theme"
        id="layout-navbar"
      >
        <div className="layout-menu-toggle navbar-nav align-items-xl-center me-3 me-xl-0 d-xl-none">
          <a
            className="nav-item nav-link px-0 me-xl-4"
            href="javascript:void(0)"
          >
            <i className="bx bx-menu bx-sm" />
          </a>
        </div>
        <div
          className="navbar-nav-right d-flex align-items-center"
          id="navbar-collapse"
        >
          {/* Search */}
          <div className="navbar-nav align-items-center">
            <div className="nav-item d-flex align-items-center">
              <i className="bx bx-search fs-4 lh-0" />
              <input
                type="text"
                className="form-control border-0 shadow-none"
                placeholder="Search..."
                aria-label="Search..."
              />
            </div>
          </div>
          {/* /Search */}
          <ul className="navbar-nav flex-row align-items-center ms-auto">
            {/* User Profile */}
            <li className="nav-item navbar-dropdown dropdown-user dropdown">
              <div
                className="nav-link dropdown-toggle hide-arrow"
                style={{ cursor: "pointer" }}
                onClick={toggleDropdown}
              >
                <div className="avatar avatar-online">
                  <img
                    src={
                      user?.profileImage
                        ? `http://localhost:4600${user.profileImage.replace(
                            /^\/+/,
                            ""
                          )}`
                        : "../assets/img/avatars/default.png"
                    }
                    alt="User Avatar"
                    className="w-px-40 h-auto rounded-circle"
                  />
                </div>
              </div>

              {isDropdownOpen && user && (
                <ul className="dropdown-menu dropdown-menu-end show">
                  <li>
                    <a className="dropdown-item" href="#">
                      <div className="d-flex">
                        <div className="flex-shrink-0 me-3">
                          <div className="avatar avatar-online">
                            <img
                              src={`http://localhost:4600${user.profileImage.replace(
                                /^\/+/,
                                ""
                              )}`}
                              alt="Profile"
                              className="w-px-40 h-auto rounded-circle"
                            />
                          </div>
                        </div>
                        <div className="flex-grow-1">
                          <span className="fw-semibold d-block">
                            {user.name}
                          </span>
                          <small className="text-muted">
                            {user.role || "User"}
                          </small>
                        </div>
                      </div>
                    </a>
                  </li>
                  <li>
                    <div className="dropdown-divider" />
                  </li>
                  <li>
                    <a className="dropdown-item" href="#">
                      <i className="bx bx-user me-2" />
                      <span className="align-middle">My Profile</span>
                    </a>
                  </li>
                  <li>
                    <a className="dropdown-item" href="#">
                      <i className="bx bx-cog me-2" />
                      <span className="align-middle">Settings</span>
                    </a>
                  </li>
                  <li>
                    <div className="dropdown-divider" />
                  </li>
                  <li>
                    <a
                      className="dropdown-item"
                      href="#"
                      onClick={handleLogout}
                    >
                      <i className="bx bx-power-off me-2" />
                      <span className="align-middle">Log Out</span>
                    </a>
                  </li>
                </ul>
              )}
            </li>
          </ul>
        </div>
      </nav>
      {/* / Navbar */}
    </div>
  );
}

export default Navbar;
